import React, { useEffect, useState } from 'react';
import Navbar from './navbar';
import './homepage.css';

const Homepage = () => {
    const [username, setUsername] = useState("");

    useEffect(() => {
        const User = localStorage.getItem("User");
        if (User) {
            setUsername(User);
        }
    }, []);

    return (
        <div className="homepage">
            <Navbar />
            <header className="header">
                <h1>Welcome to My Anime Page{username && `, ${username}`}</h1>
                <p>Explore the world of anime and discover new favorites!</p>
            </header>
            
            <section className="anime-section">
                <h2>Trending Anime</h2>
                <div className="anime-list">
                    <div className="anime-card">
                        <img src="https://source.unsplash.com/300x200/?anime" alt="Anime 1" />
                        <p>Attack on Titan</p>
                    </div>
                    <div className="anime-card">
                        <img src="https://source.unsplash.com/300x200/?manga" alt="Anime 2" />
                        <p>Demon Slayer</p>
                    </div>
                    <div className="anime-card">
                        <img src="https://source.unsplash.com/300x200/?cartoon" alt="Anime 3" />
                        <p>One Piece</p>
                    </div>
                </div>
            </section>

            <footer className="footer">
                <p>Â© 2025 My Anime Page | All Rights Reserved</p>
            </footer>
        </div>
    );
};

export default Homepage;
